lations@truecar.com</a>. Questions regarding these Terms of Service should be sent to<!-- --> <a href="mailto:legal@truecar.com">legal@truecar.com</a>.</p>
                                        <p>THE TRUECAR ENTITIES DO NOT MAKE ANY REPRESENTATION OR WARRANTY THAT YOU WILL SELL YOUR VEHICLE, OBTAIN AN ACCEPTABLE PRICE FOR YOUR VEHICLE, RECEIVE LEGITIMATE INQUIRIES OR SOLICITATIONS FROM QUALIFIED BUYERS, OR RECEIVE ANY INQUIRIES REGARDING YOUR VEHICLE FOR SALE.</p>
                                        <p><strong>18. ADDITIONAL TERMS FOR THE SELL YOUR CAR AND TRADE</strong></p>
                                        <p>TrueCar offers additional services whereby you may request (i) conditional offers to purchase your used motor vehicle (excluding certain types of vehicles) (each offer, a True Cash Offer) using the Sell Your Car service, and/or (ii) an estimated trade-in value for your used motor vehicle (excluding certain types of vehicles) (each estimate, a True Cash Estimate) using the Trade service. If you use or participate in these services, the following additional terms apply:<br>In order to request a True Cash Offer or True Cash Estimate, you must have possession of the actual vehicle, with the ability to transfer valid title as set forth herein. You are required to provide certain identifying and contact information, which must accurately identify yourself so dealers can communicate directly with you. By using these services, you represent, warrant, and covenant that you are not: (i) a motor vehicle dealer or (ii) listing a vehicle for sale in your capacity as an owner, employee, or representative of a motor vehicle dealer. For clarity, if you are a motor vehicle dealer, you may not use these services to obtain a True Cash Offer or True Cash Estimate on behalf of a customer.</p>
                                        <p>True Cash Offers and True Cash Estimates are not available in all areas, and not all vehicles are eligible. These services may not be used to sell or to trade-in certain categories of vehicles, including commercial vehicles; vehicles with a government, police, fire or livery history; motorcycles; recreational vehicles; reconstructed or salvage vehicles; vehicles without a valid VIN; grey market vehicles; vehicles older than seventeen (17) model years; vehicles with altered drivelines or bodies or illegal or non-functioning emissions equipment; flood, hail or fire damaged vehicles; vehicles with substantial mechanical or electrical damage; vehicles registered at an auto auction or offered for sale on a wholesale website within forty five (45) days prior to submitting your request; vehicles that are valued at less than $1,000; and any other category of vehicle that we, in our sole discretion, believe may adversely impact the operation of these services (each, a Restricted Vehicle).</p>
                                        <p>By requesting a True Cash Offer or True Cash Estimate, you agree that TrueCar, its service providers, Participating Dealers, and/or affinity partners may use the personal contact information you provided, including your telephone number and email address, to communicate with you about the products and services that may be of interest to you. By requesting a True Cash Offer or True Cash Estimate, you agree to use the email address or any other contact information of the Participating Dealer(s) only for purposes of communicating with them about the potential sale of that vehicle.</p>
                                        <p><span style="text-decoration:underline">Sell Your Car service</span><br>Through TrueCars Sell Your Car service, upon providing the requisite information, you can request conditional offers from dealers to purchase your used motor vehicle, known as True Cash Offers. All True Cash Offers are subject to inspection and verification of the vehicle by, or on behalf of, the purchasing dealer, as well as the terms of, and your full compliance with, these Terms of Service and any other applicable terms. A participating dealer that may make a True Cash Offer is referred to in these additional terms as a Participating Dealer. In certain situations, however, you may instead receive a True Cash Offer from TrueCar Wholesale Solutions, Inc. (TCWS), in which case TCWS will also qualify as a Participating Dealer for purposes of these additional terms.</p>
                                        <p>The Sell Your Car service enables Participating Dealers to obtain information about vehicles for which True Cash Offers have been requested and, if applicable, to contact a seller to make a True Cash Offer. We are not a party to, and do not otherwise guarantee the terms of, any True Cash Offer or any transaction resulting therefrom. You alone are responsible for any transaction you engage in resulting from a True Cash Offer from a Participating Dealer. Although Participating Dealers have agreed to abide by certain customer service standards, we are not responsible for any potential fraud or other misconduct by a Participating Dealer in connection with the Sell Your Car service. As a seller, you should exercise caution and good judgment when completing any transaction, including those involving this service.</p>
                                        <p>Vehicles with a True Cash Offer value greater than $75,000 may not be accepted by every Participating Dealer and may require an additional inspection. If you solicit True Cash Offers for any Restricted Vehicle using the Sell Your Car service, you may not receive a True Cash Offer for such vehicle and, in the event that you do receive a True Cash Offer for such vehicle, you acknowledge and agree that such True Cash Offer may be invalidated and that no Participating Dealer is required to purchase such vehicle from you.</p>
                                        <p>You acknowledge that if you provide any false, incomplete, or inaccurate information, including vehicle information or personal contact information, your True Cash Offer may be invalidated by the Participating Dealer.</p>
                                        <p>Before submitting a request to receive a True Cash Offer from Participating Dealers, you may be able to view an estimated value associated with your vehicle. For the avoidance of doubt, any estimated value shown during this process is for informational purposes only and does not constitute, and should not be construed as, a True Cash Offer or otherwise as an offer or conditional offer by TrueCar, a dealer, or any third party to purchase your used motor vehicle.</p>
                                        <p>Although a Participating Dealer is not obligated to purchase your vehicle for any price other than the amount of your True Cash Offer (subject to your satisfaction of the requirements herein), you can try to negotiate a more favorable price for your vehicle and, of course, you are always free to sell or trade in your vehicle outside of the TrueCar platform. The sale price that you could receive for your vehicle in the open market or from another source may be higher than the amount of the True Cash Offer you receive.</p>
                                        <p>To receive a True Cash Offer from a Participating Dealer: (1) your vehicle must be located in a market in which the Sell Your Car service is offered and registered in the same state as the location of the applicable Participating Dealer, unless the applicable Participating Dealer is TCWS; (2) you must be the registered owner of the vehicle; (3) you must possess a valid drivers license or other form of valid government-issued photo ID; (4) you must provide accurate, complete, and truthful personal contact information and responses to all questions included in the online questionnaire, including those relating to the description and condition of your vehicle; and (5) you must deliver your vehicle, with a valid registration and either clear and unencumbered title in your name or complete documentation regarding any lease obligations or liens on your vehicle (including, for example, contact information for your lender or leasing company, relevant account information and the current loan payoff amount or lease early termination fee for your vehicle), within 72 hours of the issuance of your True Cash Offer, to the Participating Dealer, or its designated location, for inspection by, or on behalf of, the Participating Dealer.</p>
                                        <p>You are responsible for the information contained in the vehicle questionnaire, the content of all communications you transmit through the Sell Your Car service, and any other information you provide. We may perform random or selective quality assurance tests to confirm that individuals who request a True Cash Offer are not automobile dealers and are prepared to sell such vehicles through the service. By using the Sell Your Car service, you agree to cooperate in these quality assurance tests. If the tests reveal, or we otherwise learn, that a seller is violating these Terms of Service or engaging in other unfair or deceptive practices, TrueCar may, in its sole discretion, deny that seller use of the Sell Your Car service or any other TrueCar services.<br>Following your delivery of the applicable vehicle to the designated location, your Participating Dealer or its third-party designee will conduct a mandatory vehicle inspection free of charge to confirm the vehicle description and condition information that you provided as part of your request for a True Cash Offer. This confirmation inspection may include a road test, a mechanical inspection, a review of vehicle history reports and disclosure statements regarding flood, salvage, and/or odometer discrepancies (including rollbacks), and any other reasonable tests and/or inspections that the Participating Dealer deems necessary or advisable. In the event that the inspection reveals misrepresentations and/or inconsistencies in the vehicle condition identified by you, the Participating Dealer may (1) refuse to purchase the vehicle or (2) provide a revised True Cash Offer to you based on the actual condition of the vehicle as determined through the inspection (for clarity, such revised True Cash Offer shall invalidate and replace any prior True Cash Offers created prior to the inspection). You acknowledge and agree that we have no involvement in, or liability in connection with, the Participating Dealer or its third-party designees inspection of your vehicle.</p>
                                        <p>Upon the satisfactory inspection of your vehicle by or on behalf of the Participating Dealer, and subject to any payments necessary to clear title as set forth below, the Participating Dealer will make a payment to you by check or ACH transfer in the amount of the valid True Cash Offer as reduced by such payments as may be required to secure the release of all applicable liens and lease obligations and the receipt of a clear and unencumbered vehicle title. The Participating Dealer will have sole discretion to decide whether payments will be available via check, ACH, or both. All payments will be made payable to the vehicle owner(s) named on the vehicle title.<br>If you have negative equity in your vehicle (i.e., your outstanding loan balance or lease payment obligation exceeds the amount of your True Cash Offer), you will be responsible for paying the difference between the True Cash Offer price and the amount needed to clear the title to your vehicle by certified check or other form of payment acceptable to the Participating Dealer before your transaction can be completed. If you have positive equity in your vehicle, the Participating Dealer will issue you a check for the difference between the amount needed to clear the title to your vehicle and the True Cash Offer price. The Participating Dealer will assist you with processing of the paperwork and payments necessary to settle your loan or lease obligations and to obtain a clear title to your vehicle. The process of Participating Dealer issuing you a check in connection with your positive equity in your vehicle typically takes 10 to 14 days following delivery of a vehicle to a Participating Dealer, but could take longer in some circumstances.</p>
                                        <p><span style="text-decoration:underline">Trade service</span><br>Through TrueCars Trade service, upon providing the requisite information, you can request that Participating Dealers present an estimated trade-in value for your used motor vehicle, known as a True Cash Estimate. Each True Cash Estimate is for informational purposes only and does not constitute, and should not be construed as, a True Cash Offer or otherwise as an offer or conditional offer by TrueCar, a dealer, or any third party to purchase your used motor vehicle.</p>
                                        <p>You can try to negotiate a more favorable trade-in value for your vehicle and, of course, you are always free to sell or trade in your vehicle outside of the TrueCar platform. The sale price or trade-in value that you could receive for your vehicle in the open market or from another source may be higher than the amount of the True Cash Estimate you receive.</p>
                                        <p>The Trade service enables Participating Dealers to obtain information about vehicles for which True Cash Estimates have been requested and, if applicable, to present a True Cash Estimate. We are not a party to any True Cash Estimate or any potential related transaction that may eventually result therefrom. Although Participating Dealers have agreed to abide by certain customer service standards, we are not responsible for any potential fraud or other misconduct by a Participating Dealer in connection with the Trade service, and you should exercise caution and good judgment when completing any transaction, including those relating to this service.</p>
                                        <p>TRUECAR DOES NOT MAKE ANY REPRESENTATION OR WARRANTY THAT YOU WILL BE ABLE TO SELL OR TRADE YOUR VEHICLE, OBTAIN AN ACCEPTABLE PRICE FOR YOUR VEHICLE, RECEIVE ANY INQUIRIES OR SOLICITATIONS FROM POTENTIAL PARTICIPATING DEALERS, OR RECEIVE ANY TRUE CASH ESTIMATE RELATING TO, OR TRUE CASH OFFER FOR, YOUR VEHICLE. IN THE EVENT THAT ANY CLAIMS OR DISPUTES ARISE OUT OF AN ACTUAL OR POTENTIAL TRANSACTION FOR YOUR VEHICLE, YOU AGREE TO LOOK SOLELY TO THE PARTICIPATING DEALER FOR YOUR REMEDY AND NOT TO TRUECAR, ITS PARTNERS, OFFICERS, DIRECTORS, EMPLOYEES, AGENTS, OR AFFILIATES (except in cases where TCWS was the applicable Participating Dealer).</p>
                                        <p><strong>19. ADDITIONAL TERMS FOR PRE-QUALIFIED AUTO FINANCING WITH PARTICIPATING LENDERS</strong><br>Prior to visiting a participating dealer, you may submit a request to a participating lender listed below to see if you pre-qualify for auto financing with no impact to your credit score. Eligibility for pre-qualification offers from participating lenders is determined by the participating lender based on the information you submitted. TrueCar does not play a role in that determination. Pre-qualified auto financing terms are not guaranteed and subject to change based on the lenders evaluation of your credit application submitted at the dealer and any required documents. You are encouraged to review the lenders website for additional information about the pre-qualification process.</p>
                                        <p>Participating lenders provide financing for vehicles from participating dealers. Participating dealers are subject to change. You are encouraged to verify the accuracy of any third party information on your own.</p>
                                        <p>Participating Lenders:</p>
                                        <ul style="padding-left:40px;list-style:circle" class="space-y-2">
                                            <li>Westlake Financial Services</li>
                                            <li>GoFi LLC</li>
                                        </ul>
                                        <p>THE TRUECAR ENTITIES DO NOT MAKE ANY REPRESENTATION OR WARRANTY THAT YOU WILL BE ABLE TO OBTAIN PRE-QUALIFICATION OFFERS FROM POTENTIAL PARTICIPATING LENDERS OR OBTAIN FINANCING IN CONNECTION WITH A VEHICLE. IN THE EVENT THAT ANY CLAIMS OR DISPUTES ARISE OUT OF AN ACTUAL OR POTENTIAL TRANSACTION INVOLVING THE PRE-QUALIFICATION SERVICE, YOU AGREE TO LOOK SOLELY TO THE PARTICIPATING LENDER FOR YOUR REMEDY AND NOT TO THE TRUECAR ENTITIES.</p>
